import React from "react";
import { Menu } from 'semantic-ui-react'
export class NavMenu extends React.Component{
    render(){
        return(
            <Menu inverted>
            <Menu.Item
              name='home'

            />
            <Menu.Item
              name='github commits :)'

            />

          </Menu>
        )
    }
}
